package main import ( "encoding/binary" "fmt"
) // Função para calcular o checksum do UDP/IP usando complemento de um
func UDPChecksum(data []byte) uint16 { var sum uint32 // Processa os dados em blocos de 16 bits for i := 0; i < len(data)-1; i += 2 { // Converte dois bytes em um uint16 word := binary.BigEndian.Uint16(data[i : i+2]) sum += uint32(word) } // Se o número de bytes for ímpar, adiciona o último byte com padding if len(data)%2 != 0 { sum += uint32(data[len(data)-1]) << 8 } // Adiciona os "overflows" da soma (carry bits) for (sum >> 16) > 0 { sum = (sum & 0xFFFF) + (sum >> 16) } // Retorna o complemento de um do resultado final return uint16(^sum)
} func main() { data := []byte("HELLOUDP") checksum := UDPChecksum(data) fmt.Printf("Checksum UDP de 'HELLOUDP': 0x%X\n", checksum)
} Essa implementação reflete como os protocolos UDP e IP realizam a verificação de integridade, garantindo que os pacotes de rede cheguem corretamente ao destino.

